export function NavBar(prop) {
  return(
    <div className="container-fluid">
         <nav className="d-flex justify-content-between p-2 border-1">
           <div>
            <span className="fw-bold fs-5">{prop.BrandTitle}</span>
           </div>
           <div>
            { 
              prop.MenuItems && prop.MenuItems.map((item) => (
                <span key={item} className="px-3">
                {item}
               </span>
              ))
            }
           </div>
           
         </nav>
    </div>
  )
}
